import React, { useState } from 'react';
import './App.css';
import ReactMapGl from 'react-map-gl';

export default function App() {
  const [viewport, setViewport] = useState ({
    latitude: 45.4211,
    longitude: -75.6903,
    width: '100vw',
    height: '100vh',
    zoom: 10,
  });


  return (
    <div className="App">
      <ReactMapGl
        {...viewport}
        mapboxAccessToken={process.env.REACT_APP_MAPBOX_}
      >
        markers here
      </ReactMapGl>
    </div>
  );
}
